import React from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import Theme from './components/Theme'
import Faq from './components/Faq'

function App() {
  return (
    <div className="container">
      <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Welcome</Link>
          </li>
          <li>
            <Link to="impressionist">Impressionist</Link>
          </li>
          <li>
            <Link to="fractal">Fractals</Link>
          </li>
        </ul>
        </nav>
        <Route path="/welcome" component={ Welcome }></Route>
        <Route path="/impressionist" component={ Theme }></Route>
      </Router>

      <div>
            <Faq content={{
                question:"What are these images?",
                answer:"The images on this site are images generated by a specific type of machine-learning algorithm known as a generative adversarial network (GAN)."
            }}
            />

            <Faq content={{
                question:"How did you generate these images",
                answer:"These images were generated using the program Big Sleep, a GAN designed to generate images based on an input phrase"
            }}
            />

            <Faq content={{
                question:"How can I generate these images?",
                answer:"The Big Sleep source code is available on github and is free to use. You will need to be familiar with programming and machine learning to use Big Sleep yourself, but there is a guide on using Big Sleep for non-coders. Additionally, I have a Request form where you can request me to generate an image for you."
            }}
            />
        </div>
    </div>
  )
}

export default App;
